 const pageselector=()=>{
    var pageNum = [];
    let i , count = 0;
   if( this.state.selectpage){
     

       i=0  ;
    } else{
        i=10;
         pageNum.push(<li className="pagenum f-left" > &nbsp;<i className=" fas fa-ellipsis-v"></i></li>)
    }
       

    for(i; i<this.state.noOfpages;i++){
        if(count===10) {   
           break;
        }
        count ++;
        pageNum.push(<li className="pagenum" key={i} data-index={i} onClick={this.setItemsPerpage}> {i+1} </li>)
    }
    if(this.state.selectpage){
        pageNum.push(<li className="pagenum f-right">&nbsp;<i className=" fas fa-ellipsis-v"></i></li>)
       
    }


    return pageNum ;
}

export default pageselector;
